import Link from 'next/link';
import MyLogo from './MyLogo';

const linkStyle = {
  marginRight: 200,
};
const Header = () => (
  <div className="main">
    <MyLogo/>
    <Link href="/">
      <span>Home</span>
    </Link>
    <Link href="/about">
      <span>About</span>
    </Link> 
    <style jsx>{`
    .main{
      display: flex;
      justify-content: center;
      align-items: center;
    }
    span {
      color: white;
      padding: 40px 30px;
      text-decoration: none;
      background-color: blue;
      border: 1px solid white;
      border-radius: 50px;
    }
    `}
    </style>
  </div>
);

export default Header;
